var caretIteration = 1;
function createEvolveRepository(repositoryID){
	  var contextElement = document.getElementById("context-menu");
	  var content_ = '<a style="text-decoration:none; cursor:cell;" onclick="createNewArchitecture();" ><div class="item"><i class="fa fa-plus" aria-hidden="true"></i>New Architecture</div></a>';
	  content_ += '<a style="text-decoration:none; cursor:cell;" onclick="evolveArchitecture(\''+repositoryID+'\');"><div class="item"><i class="fa fa-plus" aria-hidden="true"></i>Evolve Architecture</div></a>';
	  
	  contextElement.innerHTML = content_;
	  contextElement.style.top = event.pageY + "px";
	  if(globalLanguage == "En"){
 	  contextElement.style.left = event.pageX + "px";
	  }else{
		  contextElement.style.left = "calc("+event.pageX+"px - 120px)";
	  }
 	  console.log("event.pageX:",event.pageX)
 	  console.log("globalLanguage:",globalLanguage)
	  contextElement.classList.add("active");

	window.addEventListener("click",function(){
	  document.getElementById("context-menu").classList.remove("active");
	});
}

