function evolveArchitecture(repositoryID){
	$( function() {
	    var dialog, form,
	    dialog = $( "#dialog-form-evolveArchitecture" ).dialog({
	      autoOpen: false,
	      height: 400,
	      width: 350,
	      modal: true,
	      buttons: {
	        [Create]: function evolve(){
				caretIteration++;
				var evolveArchitectureName = $("#evolveArchitectureName").val();
				if(evolveArchitectureName!=''){
		        	$.ajax({
				       url: "evolveRepositoryInDB",
				       async: false, 
				       type: 'POST',
				       data: {'evolveArchitectureName':evolveArchitectureName, 'repositoryID':repositoryID},
				       dataType: 'json', // added data type
				       success: function(data) {
							if(data==true){
								refreshTree();
							}else{
								$(".alert_message").html('<div class="alert alert-danger" role="alert">'+architecture_name_already_exists+'</div>');
								alert_message_function();
							}
				       }
					});

	        	dialog.dialog( "close" );
				}
	        },
	        [Cancel]: function() {
	          dialog.dialog( "close" );
	        }
	      },
	      close: function() {
	        form[ 0 ].reset();
	      }
	    });
	    form = dialog.find( "form" ).on( "submit", function( event ) {
	      event.preventDefault();
	      addUser();
	    });
	    dialog.dialog( "open" );
	  } );	
}

function crt2(){
	var toggler = document.getElementsByClassName("caret"+caretIteration);
	var i;
	for (i = 0; i < toggler.length; i++) {
		toggler[i].addEventListener("click", function() {
		    this.parentElement.querySelector(".nested").classList.toggle("active");
		    this.classList.toggle("caret-down");
	  });
	}
}